import React, { useState } from "react";
import { Menu, X } from "lucide-react";
import NoticeChat from "./components/NoticeChat";
import NoticeList from "./components/NoticeList";

function App() {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 via-white to-purple-50">
      {/* 배경 패턴 */}
      <div className="absolute inset-0 overflow-hidden pointer-events-none">
        <div className="absolute -top-40 -right-40 w-80 h-80 bg-blue-200/30 rounded-full blur-3xl"></div>
        <div className="absolute -bottom-40 -left-40 w-80 h-80 bg-purple-200/30 rounded-full blur-3xl"></div>
      </div>

      {/* 헤더 */}
      <header className="relative z-10 bg-white/80 backdrop-blur-md border-b border-gray-200/50 sticky top-0">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex items-center justify-between h-16">
            <div className="flex items-center space-x-3">
              <div className="w-10 h-10 bg-gradient-to-r from-blue-600 to-purple-600 rounded-xl flex items-center justify-center shadow-lg">
                <span className="text-white font-bold text-lg">A</span>
              </div>
              <div>
                <h1 className="text-2xl font-bold bg-gradient-to-r from-blue-600 to-purple-600 bg-clip-text text-transparent">
                  A_hub 공지센터
                </h1>
                <p className="text-sm text-gray-500">
                  AI 기반 스마트 공지 시스템
                </p>
              </div>
            </div>

            <button
              onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
              className="md:hidden p-2 rounded-lg bg-gray-100 text-gray-600"
            >
              {isMobileMenuOpen ? (
                <X className="w-5 h-5" />
              ) : (
                <Menu className="w-5 h-5" />
              )}
            </button>
          </div>
        </div>
      </header>

      {/* 메인 콘텐츠 */}
      <main className="relative z-10 max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
        <div className="grid gap-8 lg:grid-cols-2">
          {/* 챗봇 섹션 */}
          <div className="space-y-4">
            <div className="text-center lg:text-left">
              <h2 className="text-2xl font-bold text-gray-800 mb-2">
                AI 공지 어시스턴트
              </h2>
              <p className="text-gray-600">
                자연스러운 대화로 원하는 공지사항을 찾아보세요
              </p>
            </div>
            <NoticeChat />
          </div>

          {/* 공지 리스트 섹션 */}
          <div className="space-y-4">
            <div className="text-center lg:text-left">
              <h2 className="text-2xl font-bold text-gray-800 mb-2">
                최신 공지사항
              </h2>
              <p className="text-gray-600">
                모든 부서의 공지사항을 한 눈에 확인하세요
              </p>
            </div>
            <NoticeList />
          </div>
        </div>
      </main>

      {/* 푸터 */}
      <footer className="relative z-10 mt-16 bg-gray-900 text-white">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
          <div className="text-center">
            <div className="flex items-center justify-center space-x-2 mb-4">
              <div className="w-8 h-8 bg-gradient-to-r from-blue-500 to-purple-500 rounded-lg flex items-center justify-center">
                <span className="text-white font-bold">A</span>
              </div>
              <span className="text-lg font-semibold">A_hub</span>
            </div>
            <p className="text-gray-400 text-sm">
              © 2024 A_hub. AI로 더 스마트한 업무 환경을 만들어갑니다.
            </p>
          </div>
        </div>
      </footer>

      <style jsx>{`
        @keyframes fade-in {
          from {
            opacity: 0;
            transform: translateY(10px);
          }
          to {
            opacity: 1;
            transform: translateY(0);
          }
        }

        .animate-fade-in {
          animation: fade-in 0.3s ease-out;
        }
      `}</style>
    </div>
  );
}

export default App;
